import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  const screenshots = [];
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the first "Add to Cart" button (by class)
    await page.waitForSelector('.add-to-cart', { timeout: 5000 });

    // Rapid Cart Manipulation Stress Test
    // 1. Add first product to cart 5 times rapidly
    for (let i = 0; i < 5; i++) {
      const addToCartButtons = await page.$$('.add-to-cart');
      if (addToCartButtons.length > 0) {
        await addToCartButtons[0].click();
      }
    }
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_added_first_product_5x.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_added_first_product_5x.png'));

    // 2. Add second product to cart 3 times rapidly
    const addToCartButtons2 = await page.$$('.add-to-cart');
    if (addToCartButtons2.length > 1) {
      for (let i = 0; i < 3; i++) {
        await addToCartButtons2[1].click();
      }
    }
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_added_second_product_3x.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_added_second_product_3x.png'));

    // 3. Open cart (find cart icon by text or class)
    // Try to click the cart div (contains "Cart")
    await page.waitForSelector('.cart', { timeout: 5000 });
    await page.click('.cart');
    // Wait for cart modal to appear (by id or class)
    await page.waitForSelector('#cartModal', { timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_4_cart_opened.png') });
    screenshots.push(path.join(screenshotsDir, 'step_4_cart_opened.png'));

    // 4. Rapidly increment quantity of first cart item (click "+" 3 times)
    await page.waitForSelector('.cart-item .quantity-btn', { timeout: 5000 });
    const plusButtons = await page.$$('.cart-item .quantity-btn:nth-child(3)');
    if (plusButtons.length > 0) {
      for (let i = 0; i < 3; i++) {
        await plusButtons[0].click();
      }
    }
    await page.screenshot({ path: path.join(screenshotsDir, 'step_5_incremented_first_cart_item.png') });
    screenshots.push(path.join(screenshotsDir, 'step_5_incremented_first_cart_item.png'));

    // 5. Rapidly decrement quantity of first cart item (click "-" 2 times)
    const minusButtons = await page.$$('.cart-item .quantity-btn:nth-child(1)');
    if (minusButtons.length > 0) {
      for (let i = 0; i < 2; i++) {
        await minusButtons[0].click();
      }
    }
    await page.screenshot({ path: path.join(screenshotsDir, 'step_6_decremented_first_cart_item.png') });
    screenshots.push(path.join(screenshotsDir, 'step_6_decremented_first_cart_item.png'));

    // 6. Remove the second cart item rapidly (if exists)
    const removeButtons = await page.$$('.cart-item .remove-item');
    if (removeButtons.length > 1) {
      await removeButtons[1].click();
    }
    await page.screenshot({ path: path.join(screenshotsDir, 'step_7_removed_second_cart_item.png') });
    screenshots.push(path.join(screenshotsDir, 'step_7_removed_second_cart_item.png'));

    // 7. Extract cart items and their quantities for verification
    const cartItems = await page.$$eval('.cart-item', items =>
      items.map(item => {
        const title = item.querySelector('.cart-item-title')?.innerText || '';
        const quantity = item.querySelector('.quantity')?.innerText || '';
        return { title, quantity };
      })
    );

    // 8. Proceed to checkout (if button exists)
    const checkoutBtn = await page.$('.checkout-btn');
    if (checkoutBtn) {
      await checkoutBtn.click();
      await page.screenshot({ path: path.join(screenshotsDir, 'step_8_checkout_clicked.png') });
      screenshots.push(path.join(screenshotsDir, 'step_8_checkout_clicked.png'));
    }

    return {
      success: true,
      action: "Performed rapid cart add, update, remove, and checkout to stress test cart manipulation.",
      extractedData: {
        cartItems
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots,
      error: error.message
    };
  }
}
